import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import '../App.css';

//<div className='App-header'>
//<h1>Caíste, no me podés pedir nada. Todavía no funciono =)</h1>
//</div>
/*  
bombón con ganash
tableta con cereales
tableta con caramelo
tableta con menta
trufa con frutos del bosque
minihuevitos blancos
minihuevitos semiamargo
minihuevitos leche
 */
const listado = {
    'Bombón con ganash': {
        imagen: '',
        enlace: ''
    },
    'Tableta con cereales': {
        imagen: '',
        enlace: ''
    }
}

const Componente = () => {
    return (
        <div>
            {Object.entries(listado).map((artesania, datoDeLaArtesania) => (
                <div className='App-header'>
                    <h1>{artesania}</h1>
                    <img src={datoDeLaArtesania.imagen} alt='imagen' />
                    <p>{datoDeLaArtesania.enlace}</p>
                </div>
            ))}
        </div>
    )
}

export const Pedido = () => {
    return (
        <div>
            <Componente />
        </div>
    )
}
